import React from "react";
import Home from "./Home";
import Contact from "./Contact";
import About from "./About";
import Blog from "./Blog";

function NavComponents() {
  let navStyle = {
    width: "100vw",
    position:"sticky",
    top:0,
    height: 50,
    backgroundColor: "#",
    color: "white",
    listStyle: "none",
    padding: "15px",
    display: "flex",
    alignItems: "center",
    zIndex: 20,
  };
  return (
    <ul style={navStyle}>
      <Home />
      <Contact />
      <About />
      <Blog />
    </ul>
  );
}
export default NavComponents;
